import React from 'react';

class CountryFilter extends React.Component {
    render() {
        let {countryList} = this.props;

        let countries = null;
        if(!!countryList) {
            countries = countryList.map((country) => (
                <li>{country}</li>
        ));
        }
        
        return (
            <div>
                <h3>
                    COUNTRY
                </h3>
                <ul>
                    {countries}
                </ul>
            </div>
        );
    }
}

class CityFilter extends React.Component {
    render() {
        let {cityList} = this.props;

        let cities = null;
        if(!!cityList) {
            cities = cityList.map((city) => (
                <li>{city}</li>
        ));
        }
        
        return (
            <div>
                <h3>
                    CITY
                </h3>
                <ul>
                    {cities}
                </ul>
            </div>
        );
    }
}

export {CountryFilter, CityFilter}
